import React from 'react';
import Head from 'next/head';
import NormalLayout from '@/components/layouts/normal';

import './style/detail.less';

function Detail() {
  return (
    <NormalLayout>
      <Head>
        <title>First Post</title>
      </Head>
      <div className="detail-container">

      </div>
    </NormalLayout>
  );
}

export default Detail;
